  and Habitat Survey for southern Saskatchewan during 1992. The primary purpose of
  the survey is to provide information on duck production from the mid-continent breeding
  areas. Survey methods, weather and habitat conditions, production indices, and tables
  of waterfowl brood and late-nesting indices are provided.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
